$(document).ready(function () {
    // validate signIn form on keyup and submit
    $(".NewsLetter").validate({
        rules: {
            email: {
                required: true,
                email: true
            }
        },
        messages: {
            email: {
                required: "     ",
                email: "    "
            }
        },
        submitHandler: function (form) {
            $.ajax({
                type: $(form).attr('method'),
                url: $(form).attr('action'),
                data: $(form).serialize(),
            })
                .done(function (response) {
                    var res = response.split(':')
                    if (response.indexOf('success') > -1) {
                        $.toast({
                            heading: '   ',
                            text: res[1],
                            position: 'top-right',
                            loaderBg: '#ff6849',
                            icon: 'success',
                            hideAfter: 3500

                        });

                    } else {
                        $.toast({
                            heading: '   ',
                            text: res[1],
                            position: 'top-right',
                            loaderBg: '#ff6849',
                            icon: 'error',
                            hideAfter: 3500

                        });
                    }
                });

        }
    });


    $(".PostComment").validate({
        rules: {
            comment: {
                required: true,
            }
        },
        messages: {
            comment: {
                required: "     "
            }
        },
        submitHandler: function (form) {
            $.ajax({
                type: $(form).attr('method'),
                url: $(form).attr('action'),
                data: $(form).serialize(),
            })
                .done(function (response) {
                    var res = response.split(':')
                    if (response.indexOf('success') > -1) {
                        $.toast({
                            heading: ' ',
                            text: res[1],
                            position: 'top-right',
                            loaderBg: '#ff6849',
                            icon: 'success',
                            hideAfter: 3500

                        });

                    } else {
                        $.toast({
                            heading: ' ',
                            text: res[1],
                            position: 'top-right',
                            loaderBg: '#ff6849',
                            icon: 'error',
                            hideAfter: 3500

                        });
                    }
                });

        }
    });

})